import logo from "./logo.svg";
import "./App.css";

function App() {
  const logo =
    "https://i.pinimg.com/originals/16/46/24/1646243661201a0892cc4b1a64fcbacf.jpg";

  return (
    <div>
      <img src={logo} alt="banner" />
      <div></div>
    </div>
  );
}

export default App;
